import React from 'react';
import logo from './assets/img/iimt_logo_icon.png'; // Adjust the path to your logo
import image from './assets/img/im'; // Adjust the path to your image
import './App.css'; // Import the custom CSS

const Header = () => {
  return (
    <div className="header-container">
      <img src={logo} alt="College Logo" className="logo" />
      <img src={image} alt="Banner Image" className="image" />
    </div>
  );
};

export default Header;
